<?php

namespace Ukpos\ScheduledBanners\Helper;

use Magento\Framework\App\Helper\AbstractHelper;
use Magento\Framework\App\RequestInterface;

/**
 *
 */
class Data extends AbstractHelper
{
    protected $request;

    public function __construct(RequestInterface $request)
    {
        $this->request = $request;
    }

    /**
     * Get the variable_set parameter from the request.
     *
     * @return string|null
     */

    public function getVariableSet()
    {
        return $this->request->getParam('variable_set', '');
    }

    /**
     * Get scheduled banners JSON data.
     *
     * @return string
     */
    public function getScheduledBannersJson()
    {
        // Todo: This needs work
        // Hardcoded JSON for testing
        return '{
            "id": "homepage_banners",
            "variables": [
                {"id": "primary_banner_title", "value": "10% off today only"},
                {"id": "primary_banner_promo_id", "value": "promo123"},
                {"id": "primary_banner_promo_creative", "value": "Creative Image"}
            ]
        }';
    }

    /**
     * Get the value of a variable by its ID.
     *
     * @param $variableId
     * @return mixed|string
     */
    public function getVariableValue($variableId)
    {
        $jsonData = json_decode($this->getScheduledBannersJson(), true);
        foreach ($jsonData['variables'] as $variable) {
            if ($variable['id'] === $variableId) {
                return $variable['value'] ?? '';
            }
        }
        return '';
    }
}


